INSERT INTO `kr_articles` (`id`, `title`, `teaser`, `text`, `views`, `active`, `picture_id`, `language`, `affiliate_id`, `date`) VALUES
(1, 'Conferinta despre Programul National de Screening al Cancerului de Col Uterin', 'Incheiem anul cu o conferință despre Programul Național de Screening al Cancerului de Col Uterin', 'Incheiem anul cu o conferință despre Programul Național de Screening al Cancerului de Col Uterin și sperăm ca din 2016 să avem ocazia să vorbim și să facem din ce în ce mai mult prevenție.', 0, 1, 1, 'ro', 1, '2016-02-22'),
(2, 'Un al 2 lea articol de test', 'It is a long established fact that a reader will be distracted by the readable content of a page.\n', '<b>It is a long established fac</b>t that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using ''Content here, content here'', making it look like readable English. Many desktop publishing packagesIt is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using ''Content here, content here'', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for ''lorem ipsum'' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like). now use Lorem Ipsum as their default model text, and a search for ''lorem ipsum'' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpos<b>e (injected humour and the</b> like).', 0, 1, 2, 'ro', 1, '2016-02-20'),
(3, 'Call for volunteers – Caravana nr 5 – Sanislau, jud Satu Mare', '<p>Echipa Caravana cu Medici cauta membri noi!<br></p>', '<p><div>Echipa Caravana cu Medici cauta membri noi! Daca esti medic rezident sau specialist din Cluj, Oradea, Timisoara Satu Mare, Targu Mures ni te poti alatura in cea dea V-a caravana.</div><div>Sambata, 7 &nbsp;Noiembrie, vom oferi consultatii si investigatii (ecografie abdominala, san, ecg) gratuite in Com. Sanislau, jud Satu Mare. Toate costurile legate de drum, cazare si mancare sunt acoperite. Daca te incanta ideea de voluntariat si doresti sa oferi ceva comunitatii tale, asteptam aplicatia ta.</div><br></p>\n', 0, 1, 4, 'ro', 1, '2015-10-16'),
(4, 'Caravana nr. 4 – Negreni, jud. Olt', '<p>Au loc pregatiri intense pentru caravana cu Numarul 4!<br></p>', '<p>Au loc pregatiri intense pentru caravana cu Numarul 4 ce va avea loc in localitatea Negreni, jud Olt in weekend-ul&nbsp;10-11 octombrie 2015. Cei interesati sa participe sau care doresc sa ne ajute ne pot contacta prin urmatorul formular: <a href="https://docs.google.com/forms/d/1-hZyuWOzx5A5Kitc5rHJVj0PUgd1wObbHZgNJ7uqSNk/viewform?c=0&amp;w=1&amp;usp=mail_form_link ">https://docs.google.com/forms/d/1-hZyuWOzx5A5Kitc5rHJVj0PUgd1wObbHZgNJ7uqSNk/viewform?c=0&amp;w=1&amp;usp=mail_form_link&nbsp;</a><br></p>\n', 0, 1, 5, 'ro', 1, '2015-09-14'),
(5, 'O noua Caravana!', '<p>Organizam o noua caravana in comuna Potlogi, jud. Dambovita.<br></p>', '<p>Organizam o noua caravana in comuna&nbsp;<strong>Potlogi, jud. Dambovita</strong>. Pe data de&nbsp;<strong>8 august</strong>&nbsp;o echipa formata din 30 de studenti, medici rezidenti si specialisti va realizare timp de o zi examene clinice si consulturi de specialiate impreuna cu analize de sange avansate. Ne dorim sa vedem intre 150-200 de persoane pe care sa le diagnosticam si sa le oferim un plan de tratament. Cei interesati sa participe la caravana si care doresc sa ne ajute ne pot contacta pe adresa de mail <a href="caravanacumedici@gmail.com">caravanacumedici@gmail.com</a>.<br></p>\n', 0, 1, 6, 'ro', 1, '2015-08-01'),
(6, 'Caravana Nanesti, Jud Vrancea', '<p>6 iunie 2015. O caravana reusita!<br></p>', '<p>O caravana reusita. Un loc plin de oameni frumosi. Multumim pentru sprijin Synevo. Multumim primariei Nanesti si Fam. Stoica. Multumim Scolii Gimnaziale pentru gazduire precum si tuturor celor care au asigurat cazarea voluntarilor. Multumim Fam Nita si Centrului de Meditatii si Dezvoltare Personala. Aplauze pentru partenerii din Fundatia Romtens. Felicitari voluntarilor!<br></p>', 0, 1, 7, 'ro', 1, '2015-07-27'),
(7, 'Caravana Naieni, judetul Buzau', '<p>In perioada 21 – 22 martie 2015&nbsp; o echipa formata din 48 de medici primari si rezidenti s-au deplasat in comuna Naeni din judetul Buzau pentru a oferi consultatii si analize medicale pentru 250 de pacienti.<br></p>', '<p><p>In perioada 21 – 22 martie 2015&nbsp; o echipa formata din 48 de medici primari si rezidenti s-au deplasat in comuna Naeni din judetul Buzau pentru a oferi consultatii si analize medicale pentru 250 de pacienti.</p><p>Scopul caravanei este de a acorda sansa la un consult medical de specialitate localnicilor cu o situatie financiara deficitara.&nbsp; Medicii voluntari ai caravanei provin din urmatoarele specialitati:&nbsp;<em>cardiologie, radiologie, oftalmologie, neurologie, pediatrie, medicina interna, oncologie, gastroenterologie si chirurgi generala</em>. Toate investigatiile sunt gratuite.</p><p>Printre acestea se numara: recoltarea din sange prin punctie venoasa (cu ajutorul unui echipas mobil Synevo), examen clinic complet cu electrocardiograma, ecografie abdomina si examen oftalmologic, consult de specialitate cu recomandari si scrisoare medicala.</p><p>Aceasta caravana s-a desfasurat sub egida Societatii Romane de Medicina Interna si in colaborare cu Clinica de Nefrologie si Medicina Interna a Institutului Clinic Fundeni. Analizele sunt oferite de Synevo.</p><p>Acasta este lista cu toţi medicii care au participat la Caravana, carora le multumim:</p><p>Conf. Dr.Ismail Gener –&nbsp; Medic Specialist Nefrologie – Seful sectiei de Medicina Interna-Nefrologie Institutul Clinic Fundeni</p><p>Motoi Otilia – Medic Specialist Medicina Interna</p><p>Ditoiu Alexe – Medic Specialist Medicina Interna si Gastroenterologie</p><p>Mihaila Mariana – Medic Specialist Medicina Interna</p><p>Micu Laurentiu – Medic Specialist Medicina Interna</p><p>Radu Dumitru – Medic Specialist Radiologie si Imagistica Medicala</p><p>Rizoiu Andi – Medic Specialist Dermatologie</p><p>Nistor Mihaela&nbsp; – Medic Rezident Pediatrie</p><p>Ranete Mihai – Medic Rezident Radiologie si Imagistica Medicala</p><p>Ispas Miruna – Medic Rezident Radiologie si Imagistica Medicala</p><p>Vasile Cristian – Medic Rezident Radiologie si Imagistica Medicala</p><p>Berbecar Vlad – Medic Rezident Medicina Interna</p><p>Negrea Claudia – Medic Rezident Medicina Interna</p><p>Mihalcea Razvan – medic rezident Medicina Interna</p><p>Georgiana Minzala – Medic Rezident Medicina Interna</p><p>Pop Andrei – Medic Rezident Cardiologie</p><p>Niculescu Agatha – Medic Rezident Medicina de Urgenta</p><p>Nicula Simona – Medic Rezident Gastroenterologie</p><p>Manea Eliza – Medic Rezident Boli Infectioase</p><p>Iliescu Daniela – Medic Rezident Oftalmologie</p><p>Adela Ranete – Medic Rezident Hematologie</p><p>Pascanu Tudor – Medic Rezident Nefrologie</p><p>Matei Dragos&nbsp; – Medic Rezident Psihiatrie</p><p>Matei Bogdan – Medic Rezident Psihiatrie</p><p>Stancu Gabriel (gabone) – Medic Rezident Geriatrie</p><p>Enculescu Diana – Student</p><p>Stoichitoiu Laura – Student</p><p>Barbu Simona – Alina Student</p><p>Nedelea Irina – Student</p><p>Fetecau Bogdana Ioana – Student</p><p>Stoicescu Mirel Toma – Student</p><p>Corcau Cristina – Student</p><p>Bucur Catalina – Student</p><p>Anghelache Livia – Student</p><p>Anghelina Ana-Maria – optometrist</p><p>Zaranda Dumitrescu – Asistent Sef Synevo</p><p>Daniela Caragea – Zaranda Dumitrescu – Asistent Synevo</p><p>Liana Paunescu – Zaranda Dumitrescu – Asistent Synevo</p><br></p>', 0, 1, 8, 'ro', 1, '2015-03-23');
