(2, 'bottom_contact_box', 'bottom_contact_box', '<section class="container">\n  <h2 class="bar grey">Doneaza</h2>\n  <div class="row">\n\n        <article class="col-md-4 col-sm-6 col-xs-12 text-center empty-box"><div class="info-text text-center light-grey">\n                Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s when an unknown printer.\n                <br><br>\n                When an unknown printer took a galley of type and scrambled it to make a type specimen book.\n                <br><br>\n                <a href="/" class="btn btn-default">Doneaza</a>\n              </div></article>\n\n        <article class="col-md-4 col-sm-6 col-xs-12 empty-box"><div class="info-text contactInfo light-grey">\n                <div class="clearfix">\n                  <span class="glyphicon glyphicon-user pull-left"></span>\n                  <address class="pull-left"><strong>Contact</strong><br>Vlad Berbecar</address>\n                </div>\n                <div class="clearfix">\n                  <span class="glyphicon glyphicon-phone pull-left"></span>\n                  <address class="pull-left"><strong>Telefon</strong><br>0723429413\n                  </address>\n                </div>\n                <div class="clearfix">\n                  <span class="glyphicon pull-left">@</span>\n                  <address class="pull-left"><strong>Email</strong><br>contact@caravanacumedici.ro\n                  </address>\n                </div>\n              </div></article>\n\n        <article class="col-md-4 col-sm-12 col-xs-12 text-center empty-box"><div class="info-text fbBox"><div class="xxxlarge pull-left">f</div> <div class="fbAddress pull-left">/CaravanaCuMedici</div></div></article>\n\n  </div>\n</section>', 1),
(3, 'Pagina nu exista!', 'not_found', '<div class="page-not-found clearfix">\n    <div class="col-md-6 col-sm-6 col-xs-12 text-center">\n      <img src="/media/img/assets/images/logo.png" title="caravanacumedici.ro" alt="caravanacumedici.ro">\n    </div>\n    <div class="col-md-6 col-sm-6 col-xs-12 text-center">\n      <h1 class="bebas">Eroare 404</h1>\n      Ne pare rau pagina cautata nu exista\n    </div>\n  </div>', 1),
(4, 'Doneaza si ajuta', 'doneaza', '<h2 class="bar orange bebas">Cum donez?</h2>\n\n  <div class="article-content">\n  	<div id="carousel-example-generic" class="carousel slide" data-ride="carousel">\n      <div class="carousel-inner" role="listbox">\n        <div class="item active">\n          <img src="/media/img/assets/images/cum_donez.jpg" alt="Cum donez ?">\n        </div>\n      </div>\n    </div>\n\n  <div class="text">\n\n    <h3 class="bebas">De ce să donez?</h3>\n<p>\n«În medie la 10 000 locuitori revin: 5 farmacişti, 5 medici dentişti, 22 medici şi 63 persoane cu pregătire sanitară medie.» (Societatea Națională a Medicilor de Familie din România)\n</p>\n\n<h3 class="bebas">Descriere</h3>\n<p>\nDe 10 ori / an, timp de un weekend reunim o echipă multi-disciplinară (40-50 de medici specialiști, rezidenți, studenți), în colaborare cu  autoritățile locale.\n</p>\n<p>\nEvaluăm gratuit starea de sănătate a populației din zona respectivă prin: consult clinic, analize bioumorale, electrocardiogramă,   examene ecografice, consultații de specialitate: medicină internă, cardiologie, neurologie, oftalmologie, dermatologie, ginecologie, radiologie și imagistică medicală, pediatrie etc.\n<p>\n\n<p>\nAvem nevoie de aparatură de specialitate.\n</p>\n\n\n<h3 class="bebas">Scopul proiectului</h3>\n\nNe dorim să achiziționăm următoarele aparate:\n<ul>\n  <li>Ecograf portabil - 15000 lei</li>\n  <li>Video colposcop - 6000 lei</li>\n  <li>EKG - 2000 lei</li>\n  <li>Masa ginecologica - 1500 lei</li>\n</ul>\n\n<h3 class="bebas">Cui donez?</h3>\n<p>\nAproape 50% dintre români locuiesc în zone rurale.<br>\nNevoile populației din zonele rurale sunt mult mai grave și mai mari comparativ cu zona urbană unde se concentrează în prezent serviciile specializate.\n</p>\n\n  </div>\n\n  </div>', 1),
(5, 'Despre noi', 'despre_noi', '\n  <h2 class="bar orange bebas">Despre noi</h2>\n\n  <div class="article-content">\n  	<div id="carousel-example-generic" class="carousel slide" data-ride="carousel">\n      <div class="carousel-inner" role="listbox">\n        <div class="item active">\n          <img src="/media/img/assets/images/despre_noi.jpg" alt="Despre noi">\n        </div>\n      </div>\n    </div>\n\n  <div class="text">\n    <p>\n        Caravana cu Medici a fost înființată la începutul anului 2014 de către 5 absolvenți ai Facultății de Medicină din București, uniți de iubirea pentru oameni, pasiunea pentru medicină și având ca scop comun dorința de a asigura sănătatea tuturor semenilor.\n    </p>\n    <p>\n      Am învățat nevoia unor astfel de proiecte din experiența acumulată pe parcursul facultății ca și voluntari ai proiectului Împreună pentru Sănătatea Rurală și am decis să continuăm ceea ce am început ca și studenți.\n    </p>\n    <p>\n      Astfel alcătuim o mare echipă pentru acordarea de îngrijiri medicale în zonele defavorizate și informarea persoanelor din mediul rural pentru a obține o populație mai sănătoasă, mai responsabilă și mai dedicată propriei sănătăți și a celor din jur.\n    </p>\n  </div>\n\n  </div>\n', 1);
